    false,nt"url": null,nt"notes": "This data set is one component of a digital
    orthophoto imagery (DOI) coverage over the Southwest Florida Water Management District
    (SWFWMD) North District Area, for Fiscal Year 2010 DOI (B089) WO# 1, purchase order
    number 10POSOW0118. This dataset is comprised of 4-band stack 32-bit (red, green,
    blue and infrared bands) DOI cells in a Geotiff format, at a 1-foot pixel resolution,
    based on the Florida Statewide 5,000' x 5,000' tile system. The DOI dataset was
    created from source imagery acquired using a Leica ADS80-SH81/82 multispectral scanners
    on January 13, 20, 22-23, 26-28 and February 8, 10 2010. The companion dataset to
    the DOI includes a personal geodatabase comprised of the original imagery mosaic
    lines attributed with the dates of imagery acquisition. The DOI was developed to
    meet or exceed a verified horizontal accuracy of 7.6-feet at the 95% confidence
    interval (4.4-feet RMSE) as specified in the FGDC Geospatial Positioning Accuracy
    Standards, Part 3: National Standard for Spatial Data Accuracy (NSSDA).",nt"owner_org":
